import React from 'react';
import '../'
function Register(){
    return (
        <div className="registerContainer">
            <form className="registerForm">
                <label id="registerText">Sign IN</label>
                <input className="registerField" type="text" placeholder="email" />
                <input className="registerField" type="text" placeholder="password" />
                <input className="registerButton" type="submit" value="register" />
            </form>     
        </div>
    );
}

export default Register;
